letra:
Benignidade eterna é a de Deus, Criador,
Que escreveu nossos nomes no céu, a pátria de amor;
Regozijemo-nos de coração, cantemos-Lhe glória.
Ele, por Seu grande amor, nos dará completa vitória.

Que grande felicidade nos preparou o bom Deus!
Pois moraremos com Ele eternamente nos céus.
A Sua face veremos, então. Que grande ventura!
Todos os santos se deleitarão com tal formosura.

Na esperança vivemos, sempre pensando em Deus
Obedecendo a tudo o que nos fala dos céus.
Suas promessas se hão de cumprir; Deus é verdadeiro;
No tempo certo, dos céus descerá Jesus, o Cordeiro.

Por Sua grande bondade, Deus, nosso Pai, nos chamou;
Para a vida eterna Ele nos predestinou;
Seja bendito o nome de Deus, o Onipotente;
Nome que é, para todo o fiel, socorro presente.

Sou o caminho, disse-nos Jesus;
Nesse caminho vamos nós andar,
Firmes na fé, pois ela nos conduz,
Na esperança de, no céu, morar.

Sou a verdade, disse o Salvador;
Nessa verdade vamos nos firmar;
Ela nos leva ao reino de amor,
Onde os fieis em breve irão entrar.

Eu sou a vida, disse o Redentor;
É essa vida que suplanta o mal,
Vida perfeita, vida de amor,
Vida sublime e celestial.

Ninguém virá ao Pai, senão por Mim,
Disse Jesus, Autor da salvação;
Só no Senhor há dádivas sem fim,
Só N'Ele alcançaremos redenção.

Quando vier do céu Cristo Jesus, o Rei.
O mundo de ilusão, vencido eu terei;
Repouso celestial e vida eternal
Receberei de Deus, a Quem me consagrei.

Consiste o meu viver em agradar a Deus,
Em revestir-me aqui da vida lá dos céus;
Unido eu estou a Cristo, que me amou;
Com sangue remidor pagou os erros meus.

Bendito é o Senhor, meu Redentor, Jesus,
Que, pelo Seu amor, à glória me conduz;
O santo Seu poder aqui me faz vencer,
Bendito é o Senhor, que é a minha Luz
